import React from 'react';
import './Sidebar.css';
import { Avatar } from '@material-ui/core';

function Sidebar() {
	return (
		<div className='sidebar'>
			<div className='sidebar__header'>
				<Avatar />
			</div>
			<div className='sidebar__search'></div>
			<div className='sidebar__charts'></div>
		</div>
	);
}

export default Sidebar;
